pragma solidity ^0.8.17;
pragma abicoder v2;

import "./Ownable.sol";
import "./AccessControlEnumerable.sol";
import "./IERC721Receiver.sol";
import "./Pausable.sol";
import "./OnlyBotsToken.sol";
import "./console.sol";

contract OnlyBotsEscrow is Ownable, AccessControlEnumerable, IERC721Receiver, Pausable {
    bytes32 public constant ADMIN_ROLE = keccak256("ADMIN_ROLE");

    error UnsupportedTokenContract(address sender);
    error NoTokensRemaining();
    error WrongValue(uint256 given, uint256 expected);
    error InvalidSignature(address authSigner, address recoveredSigner);
    error AlreadyClaimed(uint256 index, uint256 currentClaimIndex);

    OnlyBotsToken public tokenContract;
    address public signer;
    uint256 public price;

    uint256[] public tokenIds;
    uint128 public currentClaimIndex = 1;
    mapping(address => uint256) public claimed;

    constructor(address payable _tokenContract) {
        _setupRole(DEFAULT_ADMIN_ROLE, owner());
        _setupRole(ADMIN_ROLE, owner());

        tokenContract = OnlyBotsToken(_tokenContract);
    }

    receive() external payable {}

    fallback() external {}

    function withdraw() external onlyRole(ADMIN_ROLE) {
        payable(msg.sender).transfer(address(this).balance);
    }

    function setTokenContract(address payable _tokenContract) external onlyRole(ADMIN_ROLE) {
        tokenContract = OnlyBotsToken(_tokenContract);
    }

    function setSigner(address _signer) external onlyRole(ADMIN_ROLE) {
        signer = _signer;
    }

    function setPrice(uint256 _price) external onlyRole(ADMIN_ROLE) {
        price = _price;
    }

    function setClaimIndex(uint128 _value) external onlyRole(ADMIN_ROLE) {
        currentClaimIndex = _value;
    }

    function setPaused(bool _value) external onlyRole(ADMIN_ROLE) {
        if (_value) {
            _pause();
        } else {
            _unpause();
        }
    }

    function setTokenIds(uint256[] calldata _tokenIds) external onlyRole(ADMIN_ROLE) {
        tokenIds = _tokenIds;
    }

    function adminTransfer(address _to, uint256 _tokenId) external onlyRole(ADMIN_ROLE) {
        tokenContract.safeTransferFrom(address(this), _to, _tokenId);
    }

    function adminClaim(address _to) external onlyRole(ADMIN_ROLE) {
        if (tokenIds.length <= 0) {
            revert NoTokensRemaining();
        }
        uint256 tokenId = removeTokenId(tokenIds.length - 1);
        tokenContract.safeTransferFrom(address(this), _to, tokenId);
    }

    function remainingTokens() external view returns (uint256) {
        return tokenIds.length;
    }

    function claim(uint8 _v, bytes32 _r, bytes32 _s) external payable whenNotPaused {
        if (tokenIds.length <= 0) {
            revert NoTokensRemaining();
        }
        if (msg.value != price) {
            revert WrongValue(msg.value, price);
        }
        if (claimed[msg.sender] >= currentClaimIndex) {
            revert AlreadyClaimed(claimed[msg.sender], currentClaimIndex);
        }
        bytes32 hash = keccak256(
            abi.encodePacked(
                "\x19Ethereum Signed Message:\n32",
                keccak256(abi.encodePacked("onlybots claim authorization|", msg.sender))
            )
        );
        address recoveredSigner = ecrecover(hash, _v, _r, _s);
        if (recoveredSigner != signer) {
            revert InvalidSignature(signer, recoveredSigner);
        }

        claimed[msg.sender] = currentClaimIndex;
        uint256 roll = getPseudoRandomZeroToNMinusOne(block.timestamp, msg.sender, tokenIds.length);
        uint256 tokenId = removeTokenId(roll);

        tokenContract.safeTransferFrom(address(this), msg.sender, tokenId);
    }

    function onERC721Received(
        address /* operator */,
        address /* from */,
        uint256 _tokenId,
        bytes calldata /* data */
    ) external whenNotPaused returns (bytes4) {
        if (msg.sender != address(tokenContract)) {
            revert UnsupportedTokenContract(msg.sender);
        }

        tokenIds.push(_tokenId);

        return IERC721Receiver.onERC721Received.selector;
    }

    function removeTokenId(uint256 index) private returns (uint256) {
        uint256 tokenId = tokenIds[index];
        if (index != tokenIds.length - 1) {
            tokenIds[index] = tokenIds[tokenIds.length - 1];
        }
        tokenIds.pop();
        return tokenId;
    }

    function getPseudoRandomZeroToNMinusOne(
        uint256 _blockTimestamp,
        address _sender,
        uint256 _n
    ) private pure returns (uint256) {
        // rand % n => 0..(n - 1)
        return (uint256(keccak256(abi.encodePacked(_sender, _blockTimestamp))) % _n);
    }
}
